import React, { Component } from 'react';
import Container from 'react-bootstrap/Container';


export class HowTo extends Component {
    render() {
        return (
            <Container fluid
                style={{
                    backgroundColor: "#007bff40",
                    margin: "2% 0 1% 0",
                    textAlign: "left",
                    padding: "1% 1% 1% 1%"
                }}
            >
                <p><strong>Description: </strong> As part of Individual Project for CS6400 this web application is for people to perform a basic assessment and risk calculation of a COVID-19 patient ending up in the ICU, developing acute respiratory distress syndrome (ARDS), and overall death. The data has been reviewed and compiled from studies published about patients in Wuhan, listed at the <a href="#legend" style={{ color: "#0056b3" }}>bottom</a>.</p>
                <p> <strong>Disclaimer: </strong> The data below is for informational purposes only. The objective is to provide an easier format to quickly review pertinent data. </p>
                <p> <strong>Hint: </strong> Tap or click on entries with ℹ️ to see statistical details. </p>

            </Container>
        )
    }
}

export default HowTo
